import React from 'react';
import { Link } from 'react-router-dom';

const RobotList = ({ robots }) => {
    return (
        <div className="flex flex-wrap justify-evenly my-12">
            {robots.map((robot) => (
                <Link to={`/robot/${robot.id}`} key={robot.id}>
                    <div className="w-full sm:w-1/2 md:w-1/3 lg:w-1/4 xl:w-1/5 p-4">
                        <div className="max-w-sm mx-auto bg-white border border-gray-200 rounded-lg shadow dark:bg-gray-200 dark:border-gray-100 my-10">
                            <div className="py-4 px-6">
                                <img className="w-48 h-48 mx-auto mb-4" src={`https://robohash.org/${robot.id}`} alt={`Robot ${robot.name}`} />
                                <h5 className="text-center mb-2 text-2xl font-bold tracking-tight text-yellow-700">{robot.name}</h5>
                                <p className="text-center text-gray-600 text-sm">{robot.model.length > 25 ? robot.model.substring(0, 25) + '...' : robot.model}</p>
                                <div className="flex justify-center mt-6">
                                    <Link to={`/robot/${robot.id}`} className="inline-flex items-center px-3 py-2 text-sm font-medium text-center text-white bg-blue-700 rounded-lg hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">
                                        View Details
                                    </Link>
                                </div>
                            </div>
                        </div>
                    </div>
                </Link>
            ))}
        </div>
    );
};

export default RobotList;
